from collections import Counter

Covid = ""
Influenza = ""

Covid = Covid.replace("T", "U")
Influenza = Influenza.replace("T", "U")

lookup_table = {
    "UUU": "Phe", "UUC": "Phe", "UUA": "Leu", "UUG": "Leu",
    "UCU": "Ser", "UCC": "Ser", "UCA": "Ser", "UCG": "Ser",
    "UAU": "Tyr", "UAC": "Tyr", "UAA": "Stop", "UAG": "Stop",
    "UGU": "Cys", "UGC": "Cys", "UGA": "Stop", "UGG": "Trp",
            
    "CUU": "Leu", "CUC": "Leu", "CUA": "Leu", "CUG": "Leu",
    "CCU": "Pro", "CCC": "Pro", "CCA": "Pro", "CCG": "Pro",
    "CAU": "His", "CAC": "His", "CAA": "Gln", "CAG": "Gln",
    "CGU": "Arg", "CGC": "Arg", "CGA": "Arg", "CGG": "Arg",
            
    "AUU": "Ile", "AUC": "Ile", "AUA": "Ile", "AUG": "Met",
    "ACU": "Thr", "ACC": "Thr", "ACA": "Thr", "ACG": "Thr",
    "AAU": "Asn", "AAC": "Asn", "AAA": "Lys", "AAG": "Lys",
    "AGU": "Ser", "AGC": "Ser", "AGA": "Arg", "AGG": "Arg",
            
    "GUU": "Val", "GUC": "Val", "GUA": "Val", "GUG": "Val",
    "GCU": "Ala", "GCC": "Ala", "GCA": "Ala", "GCG": "Ala",
    "GAU": "Asp", "GAC": "Asp", "GAA": "Glu", "GAG": "Glu",
    "GGU": "Gly", "GGC": "Gly", "GGA": "Gly", "GGG": "Gly"
}

def splitText(in_text):
    splitted = []
    while(len(in_text) >= 3):
        splitted.append(in_text[:3])
        in_text = in_text[3:]
        
    return splitted

def matchText(S):
    matched = []
    small_part = []
    for part in splitText(S):
        if (lookup_table[part] == "Stop"):
            small_part.append("Stop")
            matched.append(small_part)
            small_part = []
        else:
            small_part.append(lookup_table[part])
    return matched

def returnLongestChain(chains_in):
    longest_id = 0
    longest_length = 0
    total = 0
    for chain in chains_in:
        if (len(chain) > longest_length):
            longest_id = total
            longest_length = len(chain)
        total += 1
    return chains_in[longest_id]


chains_found_covid = matchText(Covid)
longest_chain_covid = returnLongestChain(chains_found_covid)

chains_found_influenza = matchText(Influenza)
longest_chain_influenza = returnLongestChain(chains_found_influenza)

count_covid = Counter(longest_chain_covid)
count_influenza = Counter(longest_chain_influenza)

stop_codons_covid = sum(1 for codon in splitText(Covid) if lookup_table.get(codon) == "Stop")
stop_codons_influenza = sum(1 for codon in splitText(Influenza) if lookup_table.get(codon) == "Stop")

count_covid["Stop"] += stop_codons_covid
count_influenza["Stop"] += stop_codons_influenza


print("\n--- Final Counts Including Stop Codons ---")
print("Covid:", count_covid)
print("Influenza:", count_influenza)
print("Length Covid chain:", len(longest_chain_covid))
print("Length Influenza chain:", len(longest_chain_influenza))